import React from "react"
import ExpenseItem from "./ExpenseItem"


const ExpensesContent = props => {
    // Default message if a selected year has no expenses
    let content = <p>No Expenses found</p>

    // If the selected year does have expenses, map is used
    if(props.items.length > 0){
        content = props.items.map(expense_data => 
            <ExpenseItem
                key={expense_data.id}
                title={expense_data.title}
                amount={expense_data.amount}
                date={expense_data.date}
            />
        )
    }

    return <ul className="expenses-content">

    </ul>
}

export default ExpensesContent
